import "./Header.css"
import React from "react"

const Header = () => {
    return(
        <div className="header">
            <div className="header__logo">
                <img className="header__logo--img" src="../img/favicon.svg" alt="" />
                <p className="header__logo--text">Corp</p>
            </div>
        </div>
    )
}
export default Header;
